import React from 'react'

export default function Card(props) {
  let option = props.options;
  return (
    <div>
      <div className="card mt-3" style={{ "width": "18rem", "maxHeight": "660px" }}>
          <img src="https://source.unsplash.com/random/200Ã—200/?burger" className="card-img-top" style={{"maxHeight": "220px"}} alt="..." />
          <div className="card-body">
            <h5 className="card-title">{props.foodName}</h5>
            <p className="card-text">{props.description}</p>
            <div className='container w-100'>
              <select className='m-2 h-100  bg-success rounded'>
                {Array.from(Array(10), (e, i) => {
                  return (
                    <option key={i + 1} value={i + 1}>{i + 1}</option>
                  )
                })}
              </select>

              <select className='m-2 h-100  bg-success rounded'>
                { 
                  option.map((item) => {return(<option key={item.key} value={item.value}>{item.key}</option>)})}
                
              </select>

              <div className='d-inline h-100 fs-5'>
                Total
              </div>
            </div>
          </div>
        </div>
    </div>
  )
}
